import styles from "./NavBar.module.scss";
import {AboutSection} from "../../containers/AboutSection";

export const NavBar = () => {
  return (
    <>
      <div className={styles.navbar}>
        <div className={styles.navbar__brand}>
          <p className={styles.navbar__brand_name}>
            C<span className={styles.navbar__brand_tiny}>j</span>T
            <span className={styles.navbar__brand_tiny}>ran</span>
          </p>
        </div>
        <div className={styles.navbar__links}>
        <div href={AboutSection} className={styles.navbar__links_item}>
            <p>About</p>
          </div>
          <div href="/#ProjectSection" className={styles.navbar__links_item}>
            <p>Projects</p>
          </div>
          <div to="/ContactSection" className={styles.navbar__links_item}>
            <p>Contact</p>
          </div>
          <div to="/ContactSection" className={styles.navbar__links_cv}>
            <p className={styles.cv}>CV</p>
          {/* <a
            // className={styles.cv}
            href="https://drive.google.com/file/d/1uiWEA-P7Ae5QbhsN1tWPb3-oq4yBOayz/view?usp=sharing"
          >
            CV
          </a> */}
          </div>
        </div>
      </div>

    </>
  );
};
